// Groovy
@Exported(name="jobs")
@Override

List<TopLevelItem> fullItems = new ArrayList<TopLevelItem>(items.values());
if (authorizationStrategy instanceof AuthorizationStrategy.Unsecured ||
    authorizationStrategy instanceof FullControlOnceLoggedInAuthorizationStrategy) {
    return fullItems;
}

// otherwise, filter for the ones the user has access to.
// this is a bit of a hack but it's the best we can do until we can
// move viewableItems to the super class.
// TODO: move this to AbstractItemGroup
// TODO: make this more efficient by having AbstractItemGroup maintain a viewableItems field.

    List<TopLevelItem> viewableItems = new ArrayList<TopLevelItem>();
    for (TopLevelItem item : items.values()) {
        if (item.hasPermission(Item.READ))
            viewableItems.add(item);
    }
    return viewableItems;
}

